pub export fn predict(
    input: [*]T,
    input_shape: [*]u32,
    shape_len: u32,
    result: *[*]T,
) void {
    if (log_function) |log| {
        log(@constCast(@ptrCast("Starting prediction...\n")));
    }
    //checks on the input parameters
    if (shape_len == 0) return;
    if (shape_len != 3) return;
    if (input_shape[0] != 1) return;
    if (input_shape[1] != 1) return;
    if (input_shape[2] != 8000) return;
    //computing the size of the input tensor
    var size: u32 = 1;
    for (0..shape_len) |dim_i| {
        size *= input_shape[dim_i];
    }

    //allocating space in memory for the data
    const data = allocator.alloc(T, size) catch return;
    defer allocator.free(data);
    for (0..size) |i| {
        data[i] = input[i]; // Copying input elements
    }

    //converting the shape from [*]u32 to []usize
    const usized_shape: []usize = utils.u32ToUsize(input_shape, shape_len) catch return;
    var tensor_input = Tensor(T).fromShape(&allocator, @constCast(usized_shape)) catch return;
    defer allocator.free(usized_shape);
    defer tensor_input.deinit();
    @memcpy(tensor_input.data, data);

    if (log_function) |log| {
        log(@constCast(@ptrCast("Running Unsqueeze operation...\n")));
    }
    var axes_shape_input = [_]usize{1};
    var axes_tensor_input = Tensor(i64).fromArray(&allocator, &[_]i64{2}, &axes_shape_input) catch return;

    tensMath.unsqueeze_lean(
        T, //type
        @constCast(&tensor_input), //input tensor
        &axes_tensor_input, //axes
        &tensor__unsqueeze_output_0, //output tensor
    ) catch return;

    if (log_function) |log| {
        log(@constCast(@ptrCast("Running Unsqueeze operation...\n")));
    }
    var axes_shape__constant_1_output_0 = [_]usize{1};
    var axes_tensor__constant_1_output_0 = Tensor(i64).fromArray(&allocator, &[_]i64{0}, &axes_shape__constant_1_output_0) catch return;

    tensMath.unsqueeze_lean(
        T, //type
        @constCast(&tensor__constant_1_output_0), //input tensor
        &axes_tensor__constant_1_output_0, //axes
        &tensor__unsqueeze_2_output_0, //output tensor
    ) catch return;

    if (log_function) |log| {
        log(@constCast(@ptrCast("Running Conv operation...\n")));
    }
    tensMath.conv_lean(
        T, //type
        &tensor__unsqueeze_output_0, //input
        @constCast(&tensor_conv1_weight), //kernel
        &tensor__conv1_conv_output_0, //output
        @constCast(&tensor_conv1_bias), //bias
        &[_]usize{ 1, 1 }, //stride
        &[_]usize{ 0, 1, 0, 1 }, //pads
        &[_]usize{ 1, 1 }, //dilatations
        1, //group
        "NOTSET", //auto_pad
    ) catch return;

    if (log_function) |log| {
        log(@constCast(@ptrCast("Running Relu operation...\n")));
    }
    tensMath.ReLU_lean(T, &tensor__conv1_conv_output_0, &tensor__conv1_conv_output_0) catch return;

    if (log_function) |log| {
        log(@constCast(@ptrCast("Running MaxPool operation...\n")));
    }
    tensMath.onnx_maxpool_lean(
        T,
        &tensor__conv1_conv_output_0, //Input
        &tensor__pool1_maxpool_output_0, //Output
        &[_]usize{ 1, 3 }, //kernel_shape
        &[_]usize{ 1, 3 }, //strides
        &[_]usize{ 1, 1 }, //dilations
        &[_]usize{ 0, 0, 0, 0 }, //pads
        tensMath.AutoPadType.NOTSET, //auto_pad
    ) catch return;

    if (log_function) |log| {
        log(@constCast(@ptrCast("Running Conv operation...\n")));
    }
    tensMath.conv_lean(
        T, //type
        &tensor__pool1_maxpool_output_0, //input
        @constCast(&tensor_conv2_weight), //kernel
        &tensor__conv2_conv_output_0, //output
        @constCast(&tensor_conv2_bias), //bias
        &[_]usize{ 1, 1 }, //stride
        &[_]usize{ 0, 1, 0, 1 }, //pads
        &[_]usize{ 1, 1 }, //dilatations
        1, //group
        "NOTSET", //auto_pad
    ) catch return;

    if (log_function) |log| {
        log(@constCast(@ptrCast("Running Relu operation...\n")));
    }
    tensMath.ReLU_lean(T, &tensor__conv2_conv_output_0, &tensor__conv2_conv_output_0) catch return;

    if (log_function) |log| {
        log(@constCast(@ptrCast("Running MaxPool operation...\n")));
    }
    tensMath.onnx_maxpool_lean(
        T,
        &tensor__conv2_conv_output_0, //Input
        &tensor__pool2_maxpool_output_0, //Output
        &[_]usize{ 1, 3 }, //kernel_shape
        &[_]usize{ 1, 3 }, //strides
        &[_]usize{ 1, 1 }, //dilations
        &[_]usize{ 0, 0, 0, 0 }, //pads
        tensMath.AutoPadType.NOTSET, //auto_pad
    ) catch return;

    if (log_function) |log| {
        log(@constCast(@ptrCast("Running Shape operation...\n")));
    }
    tensMath.shape_onnx_lean(
        T,
        T, //type
        @constCast(&tensor__pool2_maxpool_output_0), //input tensor
        null, //start
        null, //end
        &tensor__shape_output_0, //output tensor,
    ) catch return;

    if (log_function) |log| {
        log(@constCast(@ptrCast("Running Gather operation...\n")));
    }
    //creating the indices Tensor(usize)

    const usize_slice__constant_output_0 = utils.sliceToUsizeSlice(tensor__constant_output_0.data);
    var usize_tensor__constant_output_0 = Tensor(usize).fromConstBuffer(&allocator, usize_slice__constant_output_0, tensor__constant_output_0.shape);
    //defer usize_tensor__constant_output_0.deinit();

    tensMath.gather_lean(
        T, //type
        @constCast(&tensor__shape_output_0), //data tensor
        &usize_tensor__constant_output_0, //indices tensor
        0, //axis
        &tensor__gather_output_0, //output tensor
    ) catch return;

    if (log_function) |log| {
        log(@constCast(@ptrCast("Running Unsqueeze operation...\n")));
    }
    var axes_shape__gather_output_0 = [_]usize{1};
    var axes_tensor__gather_output_0 = Tensor(i64).fromArray(&allocator, &[_]i64{0}, &axes_shape__gather_output_0) catch return;

    tensMath.unsqueeze_lean(
        T, //type
        @constCast(&tensor__gather_output_0), //input tensor
        &axes_tensor__gather_output_0, //axes
        &tensor__unsqueeze_1_output_0, //output tensor
    ) catch return;

    if (log_function) |log| {
        log(@constCast(@ptrCast("Running Concat operation...\n")));
    }
    // Create a list of tensors to concatenate
    var concat_tensor_list = [_]Tensor(T){ tensor__unsqueeze_1_output_0, tensor__unsqueeze_2_output_0 };

    // Perform concatenation
    tensor__concat_output_0 = tensMath.concatenate(T, &allocator, &concat_tensor_list, 0) catch return;

    if (log_function) |log| {
        log(@constCast(@ptrCast("Running Reshape operation...\n")));
    }
    const newShape_tensor__concat_output_0: []f32 = (tensor__concat_output_0.data);
    //defer allocator.free(newShape_tensor__concat_output_0);
    tensMath.reshape_lean_f32(
        T, //type
        @constCast(&tensor__pool2_maxpool_output_0), //Input tensor
        newShape_tensor__concat_output_0, //New shape
        false, //allowzero
        &tensor__reshape_output_0, //Output tensor
    ) catch return;

    if (log_function) |log| {
        log(@constCast(@ptrCast("Running Gemm operation...\n")));
    }
    tensMath.gemm_lean(T, &tensor__reshape_output_0, @constCast(&tensor_fc_weight), @constCast(&tensor_fc_bias), 1e0, 1e0, false, true, &tensor_output) catch return;
    result.* = tensor_output.data.ptr;

    if (log_function) |log| {
        log(@constCast(@ptrCast("Prediction completed.\n")));
    }
}
